import Header from './components/Header';
import Slider from './components/Slider';
import './App.css';

function App() {
  const [slide, setSlide] = useState(50)

  const handleChange = (e) => setSlide(e.target.value)

  return (
    <div>
      <Header slide={slide}
              handleChange={handleChange} />

    </div>

  );
}

export default App;
